import React from "react";
import Header from "./components/Header";
import Image from "./components/Image";
import logo from "./img/im1.png";
import Oclock from "./components/CarComponents";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      helpText: "Help text",
      textChange: "",
    };
    this.inputClick = this.inputClick.bind(this);
  }
  render() {
    return (
      <div className="name">
        <p id="time"></p>
        <Header aaaa="TEXT HEADER" />
        <Header aaaa="TEXT HEADER 22222" />
        <h1>{this.state.helpText}</h1>
        <h2>{this.state.textChange}</h2>
        <input
          placeholder={this.state.helpText}
          onChange={(event) =>
            this.setState({ textChange: event.target.value })
          }
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <p>{this.state.helpText === "Help text" ? "Yes" : "NO"}</p>
        <Image image={logo} />
      </div>
    );
  }
  inputClick() {
    this.setState({ helpText: "New header" });
    console.log("Clicked");
  }
  mouseOver() {
    console.log("Mouse Over");
  }
}
const dateT = new Date().toLocaleTimeString();
const datePlace = document.getElementBiId("time");
RenderDOM.render(dateT, datePlace);

export default App;
